import React, { useEffect, useState } from "react";
import "./App.css";
import ImageViewer from "./components/ImageViewer";
import axios from "axios"

function App() {
  const [data, setData] = useState(null);

useEffect(() => {
  // Make a request for a user with a given ID
  axios.get('https://api.nasa.gov/planetary/apod?api_key=o3Q6AUmWKfMR0i7mT6lGdiIbkOaaSNAwmxRqdfQf')
  .then(function (response) {
    // handle success
    console.log(response);
    setData(response.data)
  })
  .catch(function (error) {
    // handle error
    console.log(error);
  })
  .finally(function () {
    // always executed
  });
}, [])



  return (
    <div className="App">
      <ImageViewer viewData={data}/>


    </div>
  );
}

export default App;
